svg.script:
var Vollschalt1 = document.getElementById("Vollschalt1");
var Vollschalt2 = document.getElementById("Vollschalt2");
var Schalter1 = document.getElementById("Schalter1");
var Schalter1gedrueckt = document.getElementById("Schalter1gedrueckt");
var Schalter2 = document.getElementById("Schalter2");
var Schalter2gedrueckt = document.getElementById("Schalter2gedrueckt");
var Zylinder = document.getElementById("Zylinder");
var Konus = document.getElementById("Konus");
var Druck_konisch = document.getElementById("Druck_konisch");
var Druck_zylindrisch = document.getElementById("Druck_zylindrisch");

function addEventListeners() {
    Vollschalt1.addEventListener('mousedown', gedrueckt1);
    Vollschalt1.addEventListener('mouseup', losgelassen1);
    Vollschalt1.addEventListener('mouseout', fortbewegt1);
    Vollschalt2.addEventListener('mousedown', gedrueckt2);
    Vollschalt2.addEventListener('mouseup', losgelassen2);
    Vollschalt2.addEventListener('mouseout', fortbewegt2);
}

addEventListeners()

function gedrueckt1() {
    Schalter1.classList.remove("sichtbar");
    Schalter1.classList.add("unsichtbar");
    Schalter1gedrueckt.classList.remove("unsichtbar");
    Schalter1gedrueckt.classList.add("sichtbar");

}

function losgelassen1() {
    Schalter1.classList.remove("unsichtbar");
    Schalter1.classList.add("sichtbar");
    Schalter1gedrueckt.classList.remove("sichtbar");
    Schalter1gedrueckt.classList.add("unsichtbar");
    Zylinder.classList.remove("aus");
    Zylinder.classList.add("an");
    Konus.classList.remove("an");
    Konus.classList.add("aus");
    Druck_zylindrisch.classList.add("einblenden");
    Druck_zylindrisch.classList.remove("ausblenden");
    Druck_konisch.classList.add("ausblenden");
    Druck_konisch.classList.remove("einblenden");
}

function fortbewegt1() {
    Schalter1.classList.remove("unsichtbar");
    Schalter1.classList.add("sichtbar");
    Schalter1gedrueckt.classList.remove("sichtbar");
    Schalter1gedrueckt.classList.add("unsichtbar");
}

function gedrueckt2() {
    Schalter2.classList.remove("sichtbar");
    Schalter2.classList.add("unsichtbar");
    Schalter2gedrueckt.classList.remove("unsichtbar");
    Schalter2gedrueckt.classList.add("sichtbar");
}

function losgelassen2() {
    Schalter2.classList.remove("unsichtbar");
    Schalter2.classList.add("sichtbar");
    Schalter2gedrueckt.classList.remove("sichtbar");
    Schalter2gedrueckt.classList.add("unsichtbar");
    Zylinder.classList.remove("an");
    Zylinder.classList.add("aus");
    Konus.classList.remove("aus");
    Konus.classList.add("an");
    Druck_zylindrisch.classList.add("ausblenden");
    Druck_zylindrisch.classList.remove("einblenden");
    Druck_konisch.classList.add("einblenden");
    Druck_konisch.classList.remove("ausblenden");
}

function fortbewegt() {
    Schalter2.classList.remove("unsichtbar");
    Schalter2.classList.add("sichtbar");
    Schalter2gedrueckt.classList.remove("sichtbar");
    Schalter2gedrueckt.classList.add("unsichtbar");
}
